import React from 'react';
import Tag from '../Tag/Tag';
import './Card.scss';

const Card = props => (
    <div className='card'>
        <div className='tags'>
            {
                props.tags.map(tag => <Tag 
                    key={tag.key} 
                    name={tag.name} color={tag.color}/>)
            }
        </div>
        <div className='card-title'>{props.title}</div>
        <div className='card-text'>{props.text}</div>
    </div>
)

export default Card;
